import React from "react";
import { Card, Col } from "react-bootstrap";
import Image from "react-bootstrap";

const BookItem = ({book}) => {
    
    return (
        <Col md={3} className={"mt-3"}>
            <Card style={{width: 150, cursor: 'pointer'}} border={"light"}>
                <Image src={book.img}/>
            </Card>
        </Col>
    )
}

export default BookItem;
